out vec4 fragColor;

uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Audio Uniforms
uniform float u_bass;
uniform float u_mid;
uniform float u_treble;
uniform float u_vol;

// User Parameters
uniform float u_speed;
uniform float u_glow_intensity;
uniform float u_complexity;
uniform float u_camera_dist;
uniform float u_color_hue;
uniform float u_camera_intelligence;
uniform float u_roll_intensity;
uniform float u_camera_clearance;

#define MAX_STEPS 100
#define SURF_DIST 0.001
#define MAX_DIST 50.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D Noise for surface detailing
float hash(vec3 p) {
    p = fract(p * vec3(123.34, 456.21, 789.18));
    p += dot(p, p.yzx + 19.19);
    return fract((p.x + p.y) * p.z);
}

// Signed Distance Functions
float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// The core "Techno Maze" Map
float map(vec3 p) {
    float t = iTime * u_speed;

    // Create infinite repetition
    vec3 grid = floor(p / 4.0);
    vec3 q = mod(p, 4.0) - 2.0;

    // Use hash to randomly "remove" walls or change heights
    float h = hash(grid);

    // Base floor and ceiling
    float d = 2.0 - abs(q.y);

    // Vertical Pillars/Walls
    float boxWidth = (0.8 + 0.2 * sin(t + h * 6.28)) * u_complexity;
    // Audio reaction: Bass scales the walls
    boxWidth += u_bass * 0.4;

    float walls = sdBox(q, vec3(boxWidth, 2.0, boxWidth));

    // Add "Techno Grooves" using another layer of repetition
    vec3 qGroove = mod(p, 0.5) - 0.25;
    float grooves = sdBox(qGroove, vec3(0.3, 2.1, 0.05));
    float grooves2 = sdBox(qGroove, vec3(0.05, 2.1, 0.3));

    walls = max(walls, -grooves);
    walls = max(walls, -grooves2);

    // ANTI-CLIPPING LOGIC:
    // Create a safety cylinder around the camera's theoretical path center.
    // Since the path is basically a wobble around the Z-axis, we carve out 
    // a small tunnel specifically where the camera travels.
    float pathSafety = length(q.xy) - u_camera_clearance;
    walls = max(walls, -pathSafety);

    d = min(d, walls);

    return d;
}

// Intelligent Path Finding Function
// Returns a safe coordinate for the camera to follow
vec3 getPath(float z) {
    float t = z * 0.25 * u_camera_intelligence;
    // The camera weaves through the 4.0 unit grid spacing
    // We constrain the shift slightly to ensure we stay within the corridor
    float shiftX = sin(t) * 1.3 + cos(t * 0.5) * 0.4;
    float shiftY = cos(t * 0.7) * 0.4 + sin(t * 0.3) * 0.2;
    return vec3(shiftX, shiftY, z);
}

// Calculate Normals
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    vec3 n = map(p) - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;

    // "Super Intelligent" Camera Path Logic
    float t = iTime * u_speed * 1.5;

    // Ray Origin follows the path
    vec3 ro = getPath(t);

    // Look ahead on the path (the intelligence part: predictive looking)
    float lookAheadDist = 2.0 + u_mid * 2.0; 
    vec3 target = getPath(t + lookAheadDist);

    // Calculate a dynamic Up vector that rolls with the curves
    vec3 forward = normalize(target - ro);
    vec3 right = normalize(cross(vec3(0, 1, 0), forward));

    // Banking: tilt the camera based on the rate of change of X position
    float bank = (getPath(t + 0.1).x - getPath(t - 0.1).x) * 5.0 * u_roll_intensity;
    vec3 up = normalize(cross(forward, right));

    // Apply banking rotation to the up/right vectors
    vec3 rolledUp = up * cos(bank) + right * sin(bank);
    vec3 rolledRight = right * cos(bank) - up * sin(bank);

    // Ray Direction using our calculated basis
    vec3 rd = normalize(forward * u_camera_dist + uv.x * rolledRight + uv.y * rolledUp);

    // Raymarching Loop
    float dO = 0.0;
    float glow = 0.0;

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * dO;
        float dS = map(p);
        dO += dS;

        // Accumulate glow based on proximity to surfaces
        glow += exp(-dS * (3.0 / u_glow_intensity));

        if(dO > MAX_DIST || abs(dS) < SURF_DIST) break;
    }

    // Coloring
    vec3 col = vec3(0.0);

    if(dO < MAX_DIST) {
        vec3 p = ro + rd * dO;
        vec3 n = getNormal(p);

        // Lighting
        float diff = dot(n, normalize(vec3(1, 2, -1))) * 0.5 + 0.5;

        // Base Techno Color
        col = vec3(0.01, 0.015, 0.02) * diff;

        // Neon Strips
        float strips = step(0.92, sin(p.z * 15.0 + iTime * 5.0)) * step(0.7, fract(p.y * 2.0 + p.x));
        vec3 neonColor = 0.5 + 0.5 * cos(u_color_hue + vec3(0, 2, 4) + p.z * 0.15);

        // Audio reaction for lights
        col += neonColor * strips * (1.2 + u_treble * 6.0);

        // Fresnel effect
        float fresnel = pow(1.0 - max(0.0, dot(n, -rd)), 4.0);
        col += neonColor * fresnel * (u_glow_intensity * 0.5);
    }

    // Apply Volumetric Fog / Glow
    vec3 fogColor = 0.5 + 0.5 * cos(u_color_hue + vec3(0, 2, 4));
    col += fogColor * glow * 0.012 * (1.0 + u_mid + u_bass * 0.5);

    // Distance Fog
    col = mix(col, vec3(0.002, 0.004, 0.008), 1.0 - exp(-0.0015 * dO * dO));

    // Post processing
    col = pow(col, vec3(0.4545)); // Gamma correction
    col *= 1.0 - dot(uv, uv) * 0.4; // Vignette

    fragColor = vec4(col, 1.0);
}
